import { createFlow, Flow } from 'flyde';

interface ObjectWithPrice {
  price: number;
}

const sumPrices = (objects: ObjectWithPrice[]): number => {
  let sum = 0;
  for (const obj of objects) {
    sum += obj.price;
  }
  return sum;
};

const sumPricesFlow: Flow<ObjectWithPrice[], number> = createFlow(
  (objects) => sumPrices(objects)
);
```

Usage:
```typescript
const objects: ObjectWithPrice[] = [
  { price: 10 },
  { price: 20 },
  { price: 30 },
];

sumPricesFlow(objects).then((sum) => {
  console.log(sum); // Output: 60
});
```
